import axios from "axios";
const customer = {};

customer.create = async (state) => {

  const datapost = {
    username: state.fieldUsername,
    password: state.fieldPassword,
    errorField: state.fieldErrorField
   
  }

  const res = await axios.post("http://localhost:8080/food-panda/customer",datapost)
  .then(response=>{ return response.data; })
  .catch(error=>{ return error.response; })
  
  return res;
}

export default customer
